    'interfaces/BuildWhereOptions.html': {
      url: 'interfaces/BuildWhereOptions.html',
      title: 'interface - BuildWhereOptions',
      body: "\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  BuildWhereOptions\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/commons/dtos/pagination.dto.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        \n                                            props\n                                        \n                                \n                                \n                                            Optional\n                                        \n                                            withDeleted\n                                        \n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        props\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        props:     \n\n                                    \n                                \n\n\n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        withDeleted\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        withDeleted:     boolean | \n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :     boolean | \n\n                                        \n                                    \n\n                                    \n                                        \n                                            Optional\n                                        \n                                    \n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { ApiProperty } from '@nestjs/swagger';\nimport { Transform } from 'class-transformer';\nimport { IsInt, IsNumber, Max, Min } from 'class-validator';\nimport { cloneDeep, isEmpty, isNil } from 'lodash';\n\nexport type WhereType =\n  | 'in'\n  | 'contains'\n  | 'eq'\n  | 'lt'\n  | 'lte'\n  | 'gt'\n  | 'gte'\n  | 'sin';\n\nexport type ModType = 'and' | 'or';\n\nexport type WhereTypeOptions = {\n  type: WhereType;\n  // \n  mapper?: keyof T;\n  //  or\n  mode?: ModType;\n};\n\nexport interface BuildWhereOptions {\n  props: {\n    [key in keyof Partial>]: WhereTypeOptions;\n  };\n  withDeleted?: boolean | keyof Omit;\n}\n\nexport class PaginationDto {\n  @IsNumber({\n    allowNaN: false,\n    allowInfinity: false,\n    maxDecimalPlaces: 0,\n  })\n  @ApiProperty({\n    description: '',\n  })\n  @Min(1)\n  @Transform(({ value }) => Number(value))\n  page: number;\n\n  @IsNumber({\n    allowNaN: false,\n    allowInfinity: false,\n    maxDecimalPlaces: 0,\n  })\n  @Max(100)\n  @Min(5)\n  @IsInt()\n  @ApiProperty({\n    description: '(5, 10, 20, 50, 100)',\n  })\n  @Transform(({ value }) => Number(value))\n  pageSize: number;\n\n  toSkipAndTake() {\n    return {\n      skip: (this.page - 1) * this.pageSize,\n      take: this.pageSize,\n    };\n  }\n\n  buildWhere(options: BuildWhereOptions) {\n    let where: any = {};\n    const paginationValue = this.getPaginationValue();\n    const ands: any[] = Object.keys(options.props)\n      .filter((key) => {\n        return options.props[key].mode === 'and';\n      })\n      .map((key) =>\n        this.whereBuilder(options.props[key], key, paginationValue[key]),\n      );\n    const ors: any[] = Object.keys(options.props)\n      .filter((key) => {\n        return (\n          //  mode  or  mode  true ( or)\n          options.props[key].mode === 'or' || isNil(options.props[key].mode)\n        );\n      })\n      .map((key) => {\n        console.log(key, 'key');\n        return this.whereBuilder(options.props[key], key, paginationValue[key]);\n      })\n      .filter((item) => !isEmpty(item));\n    where.OR = isEmpty(ors) ? undefined : ors;\n    where = { ...where, ...Object.assign({}, ...ands) };\n    if (options.withDeleted) {\n      if (typeof options.withDeleted === 'boolean') {\n        where.deleted = options.withDeleted;\n      } else {\n        where.deleted = {\n          eq: paginationValue[options.withDeleted],\n        };\n      }\n    }\n    return where;\n  }\n\n  buildResponse(data: T[], total: number) {\n    return {\n      data,\n      total,\n      page: this.page,\n      pageSize: this.pageSize,\n    };\n  }\n\n  private whereBuilder(wto: WhereTypeOptions, key: string, value: any) {\n    console.log(value, 'value');\n    if (value === undefined) {\n      return {};\n    }\n    switch (wto.type) {\n      case 'in':\n        return {\n          [wto.mapper ?? key]: {\n            in: value,\n          },\n        };\n      case 'contains':\n        return {\n          [wto.mapper ?? key]: {\n            contains: value,\n          },\n        };\n      case 'eq':\n        return {\n          [wto.mapper ?? key]: value,\n        };\n      case 'lt':\n        return {\n          [wto.mapper ?? key]: {\n            lt: value,\n          },\n        };\n      case 'lte':\n        return {\n          [wto.mapper ?? key]: {\n            lte: value,\n          },\n        };\n      case 'gt':\n        return {\n          [wto.mapper ?? key]: {\n            gt: value,\n          },\n        };\n      case 'gte':\n        return {\n          [wto.mapper ?? key]: {\n            gte: value,\n          },\n        };\n      case 'sin':\n        return {\n          [wto.mapper ?? key]: {\n            some: {\n              id: {\n                in: value,\n              },\n            },\n          },\n        };\n    }\n  }\n\n  private getPaginationValue() {\n    const clone = cloneDeep(this);\n    for (const key in PaginationDto.templatePaginationDtoInstance) {\n      if (PaginationDto.templatePaginationDtoInstance.hasOwnProperty(key)) {\n        delete clone[key];\n      }\n    }\n    return clone as Omit;\n  }\n\n  // type space to value space\n  static readonly templatePaginationDtoInstance = new PaginationDto();\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n",
    },
